import "./App.css";
import styled from "styled-components";
import { AccountBox } from "./components/accountBox";
import bgvideo from "./video/shopping online - video background for WebSite.mp4"

const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

function App() {
    return (
        <>
            <AppContainer>
                <AccountBox />
            </AppContainer>

            <div className='banner' >
                <video
                    autoplay
                    loop
                    muted
                >
                    <source src={bgvideo} type="video/mp4"></source>
                </video>
            </div>
        </>

    );
}

